import React from 'react'
import { Tabs } from '../../Components/CustomeDivs/Index'
const NavTab = () => {
    return(
        <Tabs>
            <p>Tabs</p>
        </Tabs>
    )
}

const ChatsProfileTabs = () => {
    return(
        <Tabs>
            <p>Tabs</p>
        </Tabs>
    )
}

const Main = () => {
    return (
        <div className='flex flex-col items-center h-screen'>
            <div className="flex items-center bg-slate-400 w-4/5">
                <NavTab/>
                
            </div>
        </div>
        

    )
    
}

export default Main
